import React ,{useStte} from 'react'

export default function Menu({ items }) {
  const[ quantity, setquantity]=useState(1)
  return (
    <div>
      <h1>{items.name}</h1>
      <img src={items.image} className="img-fluid" style={{ height: '200px', width: '200px' }} />
      <div className="flex-container">


        <div className='w-100'>
          <p>Varients</p>
          <select>
          {items.varients.map(varient=>{
            return <option value={varient}>{varient}</option>
          })}
          </select>
        </div>


        <div className='w-100'>
          <p>Quantity</p>
          <select>
           {[...Array(10).keys()].map((x ,i)=>{

            return <option value={i+1}>{i+1}</option>
            
           })}
          </select>
        </div>
      </div>
      <div className="flex-container">
        <div>

        </div>
        <div>

        </div>
      </div>
    </div>
  )
}
